We can expand the expression $(3x + A)(x + B)$ to get $3x^2 + 3Bx + Ax + AB$. We want this to be equal to $3x^2 + 14x + 8$, so we can equate the coefficients of the terms to get the following system of equations:

\begin{align*}
3B + A &= 14,\\
AB &= 8.
\end{align*}

We can solve this system of equations by first solving for $A$ in the second equation to get $A = \frac{8}{B}$. Substituting this into the first equation, we get $3B + \frac{8}{B} = 14$. Multiplying both sides by $B$ to clear the fraction, we get $3B^2 + 8 = 14B$. Rearranging this equation, we get $3B^2 - 14B + 8 = 0$. This is a quadratic equation in $B$, and we can solve it using the quadratic formula to get $B = \frac{14 \pm \sqrt{(-14)^2 - 4(3)(8)}}{2(3)}

