Now, we can substitute the expression for $x$ into the expression for $z$:
\begin{align*}
z &= \frac{7y}{10}\\
&= \frac{7}{10}\cdot\frac{5y}{2}\\
&= \frac{7}{20}x
\end{align*}

Therefore, we have that $\frac{z}{x} = \frac{7}{20}$.

